import './App.css';
import { Button } from 'antd';
import axios from "axios";

function App() {

  fetch('http://127.0.0.1:8000/api/my-models/')
  .then(response => response.json())
  .then(data => {
      console.log(data);
      // Use the data to update your React components
  });

  getTask = () => {
    axios
      .get("http://localhost:8000/api/tasks/")
      .then( (res) => console.log(res) )
  }

  return (
    <div className="App">
      <header className="App-header">
        <h1> TODO APP </h1>
        <Button type="primary" />
      </header>
    </div>
  );
}



export default App;
